import React, { useEffect, useState } from "react";
import PhoneCardDetail from "../components/PhoneCardDetail";
import * as phoneService from "../services/phone-services";

function PhoneListScreen() {
  const [phones, setPhones] = useState([]);

  useEffect(() => {
    phoneService
      .getPhones()
      .then((phones) => setPhones(phones))
      .catch((error) => console.error(error));
  }, []);

  return (
    <div className="container">
      <div className="d-flex flex-wrap">
        {phones?.map((phone) => (
          <div className="col-6 mx-3" key={phone.id}>
            <PhoneCardDetail {...phone} />
          </div>
        ))}
      </div>
    </div>
  );
}

export default PhoneListScreen;
